import { connect } from 'react-redux';
import { bindActionCreators } from "redux";
import Guest from './Guest';
import { get as _get } from "lodash";
import { getProductList ,getSearchProductList, resetSearchProductList} from '../../Store/action/product'
import { showToastMessage, setStartLoader, setStopLoader, resetToastMessage } from '../../Store/action/loader'
import { getUserProfile, clearCartData,logoutUser,resetUserProfile } from '../../Store/action/user'
import {  getUserCartDetails } from '../../Store/action/product';

import { openLogin, closeLogin,openSignup } from '../../Store/action/login'
import { getDeliveryRange,openFinetuneLocation,closeFinetuneLocation,openLocation } from '../../Store/action/location'

function mapStateToProps(state, props) {
    return {
        showLogin : state.login.showLogin,
        showSignup : state.login.showSignup,
        userLocationName : state.location.userLocationName,
        userProfile:_get(state,'user.userProfile',null),
        cartCount: state.product.addToCart ? state.product.addToCart.products.length : 0,
        addToCart: state.product.addToCart,
        productList: state.product.productList,
        searchProductList: _get(state,'product.searchProductSuccess',[])
        
    };
}

function mapDispatchToProps(dispatch) {
    return bindActionCreators({
        getProductList,
        showToastMessage,
        setStartLoader, 
        setStopLoader,
        resetToastMessage,
        openLogin,
        closeLogin,
        openSignup,
        getUserProfile,
        logoutUser,
        clearCartData,
        getDeliveryRange,
        openFinetuneLocation,
        closeFinetuneLocation,
        getUserCartDetails,
        resetUserProfile,
        getSearchProductList,
        openLocation,
        resetSearchProductList
    }, dispatch);
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(Guest);
